import { Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from './components/Login.js'

function App() {

  const Routing=()=>{
    return(
      <Routes>
          <Route path="/home" Component={Home}/>
      </Routes>
    )
  }
  return (
   <> 
      <Navbar/>
   </>
  );
}

export default App;
